import React from 'react'

const Profile = (currentUser) => {
  return (
    <div>
      <h1 className='text-3xl font-semibold text-center my-7'>Profile</h1>
      <form>
        <img src={currentUser.avatar || '/assets/avatar.png'} alt='profile' className='rounded-full h-24 w-24 object-cover cursor-pointer self-center'/>
      </form>
    </div>
  )
}

export default Profile
